import React from 'react'
import products from '../products'
import ViewProject from '../components/ViewProject'

const TestPage = () => {
    return (
            <ul className="card-list">
                {products.map(product => (
                    <ViewProject product={product} />
                ))}
            </ul>   
    )
} 

export default TestPage
